('17', '1', '2023-05-17 16:14:03', '2023-05-17 14:14:03', '<label> اسمك\n    [text* your-name autocomplete:name] </label>\n\n<label> بريدك الإلكتروني\n    [email* your-email autocomplete:email] </label>\n\n<label> الموضوع\n    [text* your-subject] </label>\n\n<label> رسالتك (اختياري)\n    [textarea your-message] </label>\n\n[submit \"إرسال\"]\n[_site_title] \"[your-subject]\"\n[_site_title] <21032@supnum.mr>\nمن: [your-name] [your-email]\nالموضوع: [your-subject]\n\nمحتوى الرسالة:\n[your-message]\n\n-- \nتم إرسال هذا البريد الإلكتروني عن طريق إحدى النماذج عبر [_site_title] ([_site_url])\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] \"[your-subject]\"\n[_site_title] <21032@supnum.mr>\nمحتوى الرسالة:\n[your-message]\n\n-- \nتم إرسال هذا البريد الإلكتروني عن طريق إحدى النماذج عبر [_site_title] ([_site_url])\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nشكراً لك. لقد تم الإرسال بنجاح.\nحدث خطأ أثناء محاولة إرسال رسالتك. يرجى المحاولة مجدداً.\nيوجد خطأ أو أكثر بأحد الحقول، يرجى التحقق ومن ثم المحاولة مرة أخرى.\nحدث خطأ أثناء محاولة إرسال رسالتك. يرجى المحاولة مجدداً.\nيجب عليك الموافقة على الشروط والأحكام قبل إرسال رسالتك.\nالرجاء ملء هذا الحقل.\nThis field has a too long input.\nهذا الحقل يحتوي على مدخلات قصيرة جداً.\nحدث خطأ غير معروف أثناء عملية رفع الملف.\nغير مسموح لك رفع الملفات من هذا النوع.\nالملف الذي تم رفعه كبير جدًا.\nحدث خطأ أثناء عملية رفع الملف.', 'نموذج الاتصال 1', '', 'publish', 'closed', 'closed', '', '%d9%86%d9%85%d9%88%d8%b0%d8%ac-%d8%a7%d9%84%d8%a7%d8%aa%d8%b5%d8%a7%d9%84-1', '', '', '2023-05-17 16:14:03', '2023-05-17 14:14:03', '', '0', 'http://monsite.mr?post_type=wpcf7_contact_form&p=17', '0', 'wpcf7_contact_form', '', '0'),
