('116', '1', '2023-06-08 16:39:42', '2023-06-08 14:39:42', '<label> Votre nom\r\n    [text* your-name autocomplete:name] </label>\r\n\r\n<label> Votre e-mail\r\n    [email* your-email autocomplete:email] </label>\r\n\r\n<label> Objet\r\n    [text* your-subject] </label>\r\n\r\n<label> Votre message (facultatif)\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Envoyer\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <21032@supnum.mr>\n[_site_admin_email]\nDe : [your-name] [your-email]\r\nObjet : [your-subject]\r\n\r\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <21032@supnum.mr>\n[your-email]\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nVeuillez renseigner ce champ.\nCe champ à une date trop tardive.\nCe champ à un numéro trop court.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier téléversé est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.\nVeuillez saisir une date au format AAAA-MM-JJ.\nCe champ à une date trop tôt.\nCe champ à une date trop tardive.\nVeuillez saisir un numéro.\nCe champ à un numéro trop court.\nCe champ a un numéro trop long.\nLa réponse à la question est incorrecte.\nVeuillez saisir votre adresse e-mail.\nVeuillez saisisr une URL\nVeuillez saisir un numéro de téléphone.', 'testflamingo', '', 'publish', 'closed', 'closed', '', 'testflamingo', '', '', '2023-06-08 16:39:42', '2023-06-08 14:39:42', '', '0', 'http://monsite.mr?post_type=wpcf7_contact_form&p=116', '0', 'wpcf7_contact_form', '', '0'),
